    <script>
        var router = new VueRouter({
            routes: [{
                path: '/center',
                component: { template: '<strong>control center</strong>' }
            },
            {
                path: '/order',
                component: { template: '<strong>control management</strong>' }
            }],
            scrollBehavior(to, from, savedPosition) {
                if (savedPosition) {
                    return savedPosition;
